import React, { useState } from "react";

import { GenericStyle, Styles } from './app_styles';
import { Table } from "./Components/Table";
import { Tabs, Tab, Content } from './Components/Tabs';
import DateFilter from './Filters/DateFilter';

import namor from 'namor'
import { useNavigate, useHistory, Redirect, Outlet } from "react-router-dom";
import { SliderColumnFilter, SelectColumnFilter, DateFilters } from "./Filters/Filters";
import { getDataFromServer, getColumns } from "./utils/dataFromServer"
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link,
  useRouteMatch,
  useParams
} from "react-router-dom";
//import { TPage } from "./Tpage";
import { NavigationBar } from "./Components/NavigationBar"
import Title from "./Components/Title"

//https://www.robinwieruch.de/react-router-nested-routes/


export function Home() {
  const navigate = useNavigate();

  const route_to_Tpage = e => {
    //console.log("blaaaa")
    // console.log(this.props.value)
    navigate("TPage")
    // navigate("TPage/${this.state.selectedGenreName}/${this.state.selectedGenre}",{
    //   state: {
    //     data: e
    //   }
    // }); // TODO: rename this
  }

  const columns = React.useMemo( //useMemo returns a memoized value- runs when one of its dependencies update.
    () => [
      {
        Header: process.env.REACT_APP_FIRST_HEADER_MAIN_TABLE,
        columns: [
          {
            Header: '',
            accessor: 'checkboxcol',
            show: false,
            Cell: ({ cell }) => (
              <Link to={`/Home/TPage/${cell.pk}`}>
                <input type="checkbox" />
              </Link>
            )
          },
          {
            Header: 'PK',
            accessor: 'pk',
            show: false,
          },
          {
            Header: 'Type',
            accessor: 'type',
            show: true,
          },
          {
            Header: 'Name',
            accessor: 'name',
            // Use our custom `fuzzyText` filter on this column

            ////onClick={route_to_Tpage}
            filter: 'fuzzyText',
            Cell: ({ cell }) => (
              <Link to={`/Home/TPage/${cell.value}`} style={{ color: 'inherit', textDecoration: 'inherit' }}>
                {/* <button value={cell.value} >  */}
                {cell.value}
                {/* </button> */}
              </Link>

            )
          },
        ],
      },
      {
        Header: process.env.REACT_APP_SECOND_HEADER_MAIN_TABLE,
        columns: [
          {
            Header: 'Version',
            accessor: 'version',
            Filter: SliderColumnFilter,
            filter: 'equals',
          },
          /*  {
              Header: 'Visits',
              accessor: 'visits',
              Filter: NumberRangeColumnFilter,
              filter: 'between',
            },*/
          {
            Header: 'Status',
            accessor: 'status',
            Filter: SelectColumnFilter,
            filter: 'includes',

            // formatter: AddButtonToCell,
          },
          /*  {
              Header: 'Profile Progress',
              accessor: 'progress',
              Filter: SliderColumnFilter,
              filter: filterGreaterThan,
            },*/
          {
            Header: 'Date',
            accessor: 'date',
            Filter: DateFilters,
            filter: 'dateFilter'
          },

        ],
      },
    ],
    []
  )

  const len = 100
  const data = getDataFromServer(process.env.REACT_APP_MAIN_TABLE_ROUTE);//React.useMemo(() => makeData(len), [])

  //const data = React.useMemo(() => makeData(len), [])
  const columns_names = getColumns(data); //use memo dont goog here

  console.log("************")
  console.log(columns_names)
  //console.log("************")
  //console.log(data)

  const [active, setActive] = useState(0);
  const handleClick = e => {
    const index = parseInt(e.target.id, 0);
    if (index !== active) {
      setActive(index);
    }
  };
  // console.log(process.env.REACT_APP_APP_NAME)
  return (

    <GenericStyle>
      <NavigationBar />
      {/* <Tabs>
       <Tab onClick={handleClick} active={active === 0} id={0}>
          A
        </Tab>
       <Tab onClick={handleClick} active={active === 1} id={1}>
          CX
        </Tab>
        <Tab onClick={handleClick} active={active === 2} id={2}>
          Updates
        </Tab>
        <Tab onClick={handleClick} active={active === 3} id={3}>
          O
        </Tab>
      </Tabs> */}
      
        <Title message="Welcom to A" />
        <Table columns={columns} data={data} columns_name={columns_names} />
      

  
    </GenericStyle>


  )
}

const range = len => {
  const arr = []
  for (let i = 0; i < len; i++) {
    arr.push(i)
  }
  return arr
}

const newPerson = () => {
  const statusChance = Math.random()
  return {
    pk: Math.floor(Math.random() * 30),
    type: namor.generate({ words: 1, numbers: 0 }),
    name: namor.generate({ words: 1, numbers: 0 }),
    age: Math.floor(Math.random() * 30),
    visits: Math.floor(Math.random() * 100),
    progress: Math.floor(Math.random() * 100),
    status:
      statusChance > 0.66
        ? 'alive'
        : statusChance > 0.33
          ? 'in progresess'
          : 'killed',

  }


}

function makeData(...lens) {
  const makeDataLevel = (depth = 0) => {
    const len = lens[depth]
    return range(len).map(d => {
      return {
        ...newPerson(),
        subRows: lens[depth + 1] ? makeDataLevel(depth + 1) : undefined,
      }
    })
  }
  const x = makeDataLevel()
  return x;
}



//export default App
